Widespread Panic | 2013.11.08 | ExploreAsheville.com Arena | Asheville, NC | 8:04 ET

Set 1:	Ain't Life Grand, Rebirtha &gt; Walkin' (For Your Love), Tickle The Truth, Good Morning Little School Girl &gt; One Arm Steve &gt; Saint Ex, Space Wrangler &gt; Chunk Of Coal (68 minutes)

Set 2:	Little Kin, Sometimes, Time Waits, Stag-O-Lee*, Slippin' Into Darkness*, Machine &gt; Barstools and Dreamers, I Walk On Guilded Splinters, Bust It Big &gt; Conrad (79minutes)

Encore:	Dream Song, The Take Out &gt; Porch Song

Notes:	*with Karl Denson, LTP 10.29.2011


Comments: 5 second dropout removed from &quot;Ain't Life Grand&quot;
